-- ----------------------------
-- Table structure for weather
-- ----------------------------
DROP TABLE IF EXISTS `weather`;
CREATE TABLE `weather` (
  `id` int(255) NOT NULL AUTO_INCREMENT COMMENT '数据编号',
  `city` varchar(20) DEFAULT NULL COMMENT '城市',
  `weather_date` date DEFAULT NULL COMMENT '天气日期',
  `low_t` int(255) DEFAULT NULL COMMENT '低温',
  `high_t` int(255) DEFAULT NULL COMMENT '高温',
  `day_type` varchar(255) DEFAULT NULL COMMENT '白天天气',
  `night_type` varchar(255) DEFAULT NULL COMMENT '夜晚天气',
  `wind_direction` varchar(255) DEFAULT NULL COMMENT '风向',
  `wind_speed` float(4,2) unsigned zerofill DEFAULT NULL COMMENT '风速（单位m/s）',
  `wind_scale` int(255) DEFAULT NULL COMMENT '风力（单位级）',
  `humidity` int(255) DEFAULT NULL COMMENT '湿度（单位%）',
  `collect_time` datetime DEFAULT NULL COMMENT '数据收集时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=27 DEFAULT CHARSET=utf8 COMMENT='天气信息';

